import React from "react";
const App = () => {
  return (
    <div>
      <h1>hello </h1>
      <input type="text" placeholder="enter somthing" />
      <br></br>
      <button class="py-4" type="submit">
        click me
      </button>
    </div>
  );
};
export default App;
